def find_kth(arr1, arr2, k):
    if not arr1:
        return arr2[k-1]
    if not arr2:
        return arr1[k-1]
    if k == 1:
        return min(arr1[0], arr2[0])

    mid = k // 2
    if len(arr1) < mid:
        return find_kth(arr1, arr2[k - len(arr1) - 1:], len(arr1) + 1)
    if len(arr2) < mid:
        return find_kth(arr1[k - len(arr2) - 1:], arr2, len(arr2) + 1)

    if arr1[mid - 1] < arr2[mid - 1]:
        return find_kth(arr1[mid:], arr2, k - mid)
    return find_kth(arr1, arr2[mid:], k - mid)

