def maxAverageOfPath(matrix):
    N = len(matrix)
    dp = [[0] * N for _ in range(N)]
    dp[0][0] = (matrix[0][0], 1)

    for i in range(1, N):
        dp[i][0] = (dp[i-1][0][0] + matrix[i][0], dp[i-1][0][1] + 1)
        dp[0][i] = (dp[0][i-1][0] + matrix[0][i], dp[0][i-1][1] + 1)

    for i in range(1, N):
        for j in range(1, N):
            if (dp[i-1][j][0] + matrix[i][j]) / (dp[i-1][j][1] + 1) > (dp[i][j-1][0] + matrix[i][j]) / (dp[i][j-1][1] + 1):
                dp[i][j] = (dp[i-1][j][0] + matrix[i][j], dp[i-1][j][1] + 1)
            else:
                dp[i][j] = (dp[i][j-1][0] + matrix[i][j], dp[i][j-1][1] + 1)

    return dp[N-1][N-1][0] / dp[N-1][N-1][1]

def maxAverageOfPath(matrix):
    rows = len(matrix)
    cols = len(matrix[0])
    for i in range(1, cols):
        matrix[0][i] += matrix[0][i - 1]
    for i in range(1, rows):
        matrix[i][0] += matrix[i - 1][0]
    for i in range(1, rows):
        for j in range(1, cols):
            matrix[i][j] += max(matrix[i - 1][j], matrix[i][j - 1])
    return matrix[-1][-1] / (rows + cols - 1)

