    sum = 0
    for i in range(0, n+1, 2):
        sum += nc(n, i)
    return sum

def nc(n, r):
    if r > n - r:
        r = n - r
    value = 1
    for i in range(r):
        value *= (n - i)
        value //= (i + 1)
    return value

