def extract_quotation(s):
    result = []
    in_quotes = False
    current = ""

    for char in s:
        if char == '"':
            if in_quotes:
                result.append(current)
                current = ""
            in_quotes = not in_quotes
        elif in_quotes:
            current += char

    return result

