def check_min_heap(arr):
    n = len(arr)
    for i in range(int(n / 2) - 1, -1, -1):
        j = 2 * i + 1
        while j < n:
            if j + 1 < n and arr[j + 1] < arr[j]:
                j += 1
            if arr[i] > arr[j]:
                return False
            j *= 2
    return True

