def left_rotate(n, d):
    INT_BITS = 32
    return (n << d) | (n >> (INT_BITS - d))

assert left_rotate(16, 2) == 64

def left_rotate(n, bits):
    return (n << bits) & 0xFFFFFFFF | (n >> (32 - bits))

assert left_rotate(16, 2) == 64

